#include <iostream>

int main() {

    //Challenge: Make an inverse number guessing game!

    int number;
    int guess;
    int rounds = 0;

    srand(time(NULL));
    std::cout << "**Avoid The Number!**\n";
    std::cout << "Avoid the CPU guessing your number!\n";

    for(int i=100;i > 0;i-=5){
        rounds++;
        std::cout << "Round " << rounds << "! Enter a number between 1 - " << i << ": ";
        std::cin >> number;

        guess = rand() % i + 1;
        std::cout << "Opponent guessed " << guess << ". ";

        if(guess==number){
            std::cout << "You lose! You got to Round " << rounds << "!\n";
            break;
        }
        else if(guess!=number && i>10){
            std::cout << "Nicely done! Next Round!\n";
        }
        else if(guess!=number && i==10){
            std::cout << "Nicely done! Final Round!\n";
        }
        else if(guess!=number && i==5){
            std::cout << "You won the game! Congratulations!\n";
        }
        else {
            std::cout << "Nicely done! Next Round!\n";
        }
    }

    std::cout << "**Thanks for playing!**";

    return 0;
}

class Solution:
    def maxSubArray(self, nums: List[int]) -> int:

        n = len(nums)
        dp = [0]*(n+1)
        max_so_far = -math.inf

        for i in range(1, n+1):
            dp[i] = max(dp[i-1] + nums[i-1], nums[i-1])
            max_so_far = max(dp[i], max_so_far)

        return max_so_far


class Solution:
    def maxSubArray(self, nums: List[int]) -> int:

        rolling_sum = 0
        max_ending_here = -float("inf")
        max_subarray_sum = -float("inf")

        for num in nums:
            # for the current num - do it
            max_ending_here = max(max_ending_here + num, num)
            max_subarray_sum = max(max_subarray_sum, max_ending_here)
        
        return max_subarray_sum
